import React, { Component } from 'react';
import { Card, Icon } from 'semantic-ui-react'
// import './test_tweet.json'
import testTweet from './testTweet'

class Test extends Component {
  constructor(props) {
    super(props);

    this.state = {
      id: testTweet.id
    };
  }

  render() {
    return (
      <Card>
        <Card.Content header='Test Header' />
        <Card.Content description='Test description' />
        <Card.Content extra>
          <Icon name='user' />
          4 Friends
        </Card.Content>
      </Card>
    );
  }
}


export default Test;
